import React from 'react'
import { FounderInfo } from 'src/data/FounderInfo.jsx'

export default function Bio() {
    const founderData = () => {
        FounderInfo.map((founder) => {
            return (
                <div>
                    <h1>{founder.name}</h1>
                    <h2>{founder.title}</h2>
                    <p>{founder.bio}</p>
                </div>
            )
        })
    }
  return (
    <div>
        {founderData}
    </div>
  )
}
